import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import PreRegisterSlideOutModal from '../src/pages/registration/PreRegisterSlideOutModal.jsx'

class PortalModal extends Component {
    render() {
        return ReactDOM.createPortal(
            <>
                {this.props.children ?
                  <PreRegisterSlideOutModal
                  postParamList={this.props.postParamList}
                  PrevoiusLoginData={this.props.PrevoiusLoginData}
                  closeModal={this.props.closeModal}
                  operation={"create"}
                  screenName={"IDS_REGISTRATION"}
                  onSaveClick={this.props.onSaveClick}
                  validateEsign={this.props.validateEsign}
                  updateStore={this.props.updateStore}
                  comboComponents={this.props.comboComponents}
                  withoutCombocomponent={this.props.withoutCombocomponent}
                  userRoleControlRights={this.props.userRoleControlRights}
                  fromDate={this.props.fromDate}
                  toDate={this.props.toDate}
                  mandatoryFields={this.props.mandatoryFields}

              />:""}
                <a href={() => false} hidden={true} id="download_data" download>""</a>
            </>,
            document.getElementById('portal-root')
        );
    }

}

export default PortalModal;
